import React from "react";
import styles from "./Portfolio.module.css";
import first from "./../../IMGS/poert1.png"
// import second from "./../../IMGS/poert2.png"
// import third from "./../../IMGS/poert3.png"

function Portfolio() {
  return (
    <div className={`${styles.portfolio} `}>
      <div
        className={`container ${styles.test}  d-flex justify-content-center align-items-center  vh-100`}
      >
        <div className={`about_content  mb-3 fs-1 fw-bolder `}>
          <h2 className={`upper-text text-center pt-4 `}> ABOUT COMPONENT</h2>
        </div>

        <div className="about_icon me-3 mb-3 ">
          <i className={`fa-solid fa-star `}></i>
        </div>

        <div className={`portfolio_cards`}>
          <div className="container">
            <div className={`row px-5`}>
              <div className={`col-lg-4 col-md-6`}>
              
                  <div class="portfolio_img rounded-3 overflow-hidden ">
                    <img src={first}></img>
                  </div>
                
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Portfolio;
